import React, {Component} from 'react';
import {Form, Input, Tabs} from "antd";

const {TabPane} =Tabs;

class OrgInfo extends Component {
    render() {
        return (
            <div>
                <Tabs defaultActiveKey='about'>
                    <TabPane tab='关于企业' key='about'>
                        <Form labelCol={{span:6}} wrapperCol={{span:12}}>
                            <Form.Item label='组织机构代码' name='orgCode'><Input/></Form.Item>
                            <Form.Item label='组织机构名称' name='orgName'><Input/></Form.Item>
                            <Form.Item label='管理员账号' name='admin'><Input/></Form.Item>
                            <Form.Item label='唯一标识' name='tagStr'><Input/></Form.Item>
                            <Form.Item label='官方站点' name='orgSite'><Input/></Form.Item>
                            <Form.Item label='联系地址' name='tagStr'><Input/></Form.Item>
                            <Form.Item label='唯一标识' name='tagStr'><Input/></Form.Item>
                            <Form.Item label='唯一标识' name='tagStr'><Input/></Form.Item>
                            <Form.Item label='唯一标识' name='tagStr'><Input/></Form.Item>
                        </Form>
                    </TabPane>
                </Tabs>
            </div>
        );
    }
}

export default OrgInfo;
